// src/components/MovieCard.js
import React from 'react';
import './MovieCard.css';

const MovieCard = ({ title, poster_url, reason }) => {
  return (
    <div style={{ backgroundColor: "#222", padding: "1rem", borderRadius: "10px", color: "#fff", width: "200px" }}>
      <img src={poster_url} alt={title} style={{ width: "100%", borderRadius: "10px" }} />
      <h4>{title}</h4>
      <p style={{ fontSize: "0.8rem" }}>{reason}</p>
    </div>
  );
};

export default MovieCard;
